    getPnlClass(runner) {
      let pnlClass = "black";

      if (this.casinoPnl) {
        _.forEach(this.casinoPnl, (value, index) => {
          if (runner.sectionId) {
            if (parseInt(value[runner.sectionId]) >= 0) {
              pnlClass = 'win';
            }

            if (parseInt(value[runner.sectionId]) < 0) {
              pnlClass = 'lose';
            }
          }

          if (runner.sid) {
            if (parseInt(value[runner.sid]) >= 0) {
              pnlClass = 'win';
            }

            if (parseInt(value[runner.sid]) < 0) {
              pnlClass = 'lose';
            }
          }
        });
      }

      return pnlClass;
    }

